import React from 'react';
import './Header.css';
import { Link } from 'react-router-dom'
import trybelogo from '../img/logo.svg';


export default function Header() {
  return (
    <header className="header">
      <nav>
        <div>
          <Link to="/"><img src={trybelogo} alt='Logo da Trybe'/></Link>
        </div>
      </nav>
    </header>
  );
}
